import React, { Component } from 'react';
import './App.css';
import Prs from './Person/Person';

class App extends Component {

  state ={
    persons: [
      {name:'Prakash',age:20},
      {name:'Prakash1',age:21},
      {name:'Prakash2',age:22},
    ]
  }

  switchNameHandler = () =>{
    console.log('Test');
  }

  render() {
    return (
      <div className="App">
       <h1>Hello</h1>
       <button onClick={this.switchNameHandler}>Switch Name </button>
       <Prs name={this.state.persons[0].name} age={this.state.persons[0].age}/>
       <Prs name={this.state.persons[1].name} age={this.state.persons[1].age}>How are you?</Prs>
       <Prs name={this.state.persons[2].name} age={this.state.persons[2].age}/> 
      </div>
    );

  }
}

export default App;
